import React, { Component } from 'react';
import logo from '../logo.svg';
import '../App.css';

class App extends Component {
  state = {
    users: []
  }

  ComponentDidMount() {
    fetch('http://jsonplaceholder.typicode.com/users')
    .then(data => data.json())
    .then(users => {
      this.setState({
        users,
      })
    })
  }

  render() {
    return (
      <div className="App">
        <h1>Users</h1>
        {
          this.state.users.map(user => 
            <div>
              {user.name} - {user.username}
            </div>
          )
        }
      </div>
    );
  }
}

export default App;
